&lt;html&gt;&lt;body&gt;&lt;div&gt;
&lt;ins data-ad-client=&quot;ca-pub-1551791779436180&quot; data-ad-format=&quot;auto&quot; data-ad-slot=&quot;3766949651&quot;&gt;&lt;/ins&gt;
&lt;/div&gt;&lt;p&gt;단위 면적당 가장 많은 감시용 CCTV가 설치된 곳이 영국의 런던이라는 얘기를 들었는데, 우리나라 역시 CCTV가 많기로는 뒤지지 않죠. 도심에 사는 분이라면 하루 평균 20여 회 정도 CCTV에 노출될 정도로 생활 속에 녹아들어 있는데요. 혹자는 이렇게 CCTV가 많은 환경으로 인해 사생활이 노출되는 것에 불만을 터트리기도 하지만, 범죄 예방 등을 위해서라면 용인하는 이도 있는데요.&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;h4&gt;&lt;span&gt;&lt;span&gt;&lt;span&gt;태풍급 강풍에도 해수에도 견뎌낼 어딘지 일본풍의 튼튼한 감시 카메라, 파나소닉 에어로 PTZ...&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;&lt;br/&gt;문제는 제대로 활용하려고 해도 너무나 화소가 낮고 영상 품질이 떨어져 범인을 제대로 구분하지 못할 정도인 경우가 많다는 겁니다. 그래서 화질이나 기능에 차별화된 CCTV가 출시되면 관심이 가는데요. 일본의 파나소닉이 얼마 전 선보인 &lt;b&gt;에어로&lt;span&gt;(Aero)&lt;/span&gt; PTZ 카메라 WV-SUD638&lt;/b&gt;는 30배 줌에 풀 HD&lt;span&gt;(1920 x 1080, 60 fps)&lt;/span&gt;의 쾌적한 화질은 물론 둥글둥글한 곡선 디자인으로 해안 지역이나 바람이 많이 부는 부는 마천루 등의 익스트림한 환경을 고려해 만들어진 제품이라고 하는데요.&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;&lt;img height=&quot;&quot; src=&quot;http://cfile1.uf.tistory.com/image/211F9E375777EEB6104AB8&quot; width=&quot;100%&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;&lt;img height=&quot;&quot; src=&quot;http://cfile26.uf.tistory.com/image/271C52375777EEB7130640&quot; width=&quot;100%&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;&lt;img height=&quot;&quot; src=&quot;http://cfile8.uf.tistory.com/image/251141375777EEB71E6F8B&quot; width=&quot;100%&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;&lt;img height=&quot;&quot; src=&quot;http://cfile2.uf.tistory.com/image/247EAB375777EEB72CDEB1&quot; width=&quot;100%&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;&lt;img height=&quot;&quot; src=&quot;http://cfile1.uf.tistory.com/image/270720375777EEB72616F3&quot; width=&quot;100%&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;특유의 유선형 디자인으로 공기 저항을 감소시키고 하이브리드 손떨림 보정 기능 등을 제공해 60m/s의 빠른 바람 하에서도 떨림 등을 최소화해 작동할 정도로 튼튼하고 믿음직한 제품이라고 하더군요. IP67급 방수/방진에 유리섬유 플라스틱 케이스 등을 사용해 소금기 많은 해풍 등에도 굳건히 작동할 수 있도록 디자인했다고 하고요. 거기에 빗물과 먼지 제거를 위한 와이퍼와 서리 제거 장치 등을 더해 다양한 활용성을 보장하는 게 눈에 띄네요. 방송사가 지역별 날씨나 풍경을 스케치하는데 쓸 수도 있겠지만, 이왕이면 범죄 예방이나 수사를 위해 이런 제품의 보급을 늘렸으면 하는 바람도 있고요. 이런 감시자가 필요 없는 사회가 우리가 지향해야 할 방향이겠지만, 그런 이상향은 너무나 멀게 느껴지니...^^&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;blockquote&gt;&lt;p&gt;[관련 링크 : &lt;a href=&quot;http://business.panasonic.com/WV-SUD638.html&quot; target=&quot;_blank&quot;&gt;Panasonic.com&lt;/a&gt;]&lt;br/&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;div&gt;
