&lt;html&gt;&lt;body&gt;&lt;div&gt;
&lt;ins data-ad-client=&quot;ca-pub-1551791779436180&quot; data-ad-format=&quot;auto&quot; data-ad-slot=&quot;3766949651&quot;&gt;&lt;/ins&gt;
&lt;/div&gt;&lt;p&gt;전 세계 시장을 대상으로 중국의 여러 기업들과 치열한 경쟁을 바탕으로 빠르게 무인항공기 드론의 경쟁력을 키워가고 있는 홍콩의 유닉&lt;span&gt;(Yuneec)&lt;/span&gt;. DJI와 비슷하게 촬영용 드론을 선보이고 있는 그들은 인텔에게 거액의 투자를 이끌어낸 후에도 신모델 개발에 적극적인데요.&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;h4&gt;&lt;span&gt;&lt;span&gt;&lt;span&gt;심도까지 인식하는 인텔 리얼센스 카메라 기술을 통해 촬영의 품격을 높일 드론, 유닉 타이푼 H...&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;&lt;br/&gt;그들이 최근 선보인 제품 중 가장 특색 있다고 할 수 있는 건 바로 인텔과 손을 잡고 만든 &lt;b&gt;타이푼 H&lt;span&gt;(Typoon H)&lt;/span&gt;&lt;/b&gt;. &lt;br/&gt;&lt;/p&gt;&lt;p&gt;타이푼 H는 사물 인식뿐 아니라 심도까지 구분할 수 있는 리얼센스&lt;span&gt;(Intel RealSense)&lt;/span&gt; 기술이 적용된 모델인데요. 인텔의 아톰 프로세서와 리얼센스 R200 카메라, 3축 진동 방지 기능을 적용하고 4K UHD 동영상까지 촬영할 수 있는 1,240만 화소 카메라 등으로 진동을 줄인 안정감 있는 촬영 능력을 보여준다고 합니다.&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;
&lt;center&gt;&lt;/center&gt;
&lt;p&gt;&lt;span&gt;&lt;img height=&quot;&quot; src=&quot;http://cfile9.uf.tistory.com/image/215D1E41576EC3CC05A59F&quot; width=&quot;100%&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;&lt;img height=&quot;&quot; src=&quot;http://cfile5.uf.tistory.com/image/255EE641576EC3CC03F082&quot; width=&quot;100%&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;또 프로펠러도 6개나 되는 헥사 콥터이다 보니 4개를 쓰는 일반적인 드론보다 안정적으로 하늘을 날 것으로 기대되는데요.&lt;/p&gt;&lt;p&gt;촬영을 방해할 수 있는 랜딩 기어를 접는 기능부터 장애물 회피, 설정 경로 비행, 사용자 주변을 선회 비행 등 다양한 특화 비행 기능을 가지고 있는데요. &lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;&lt;img height=&quot;&quot; src=&quot;http://cfile9.uf.tistory.com/image/217B8E3D576EC3F019FD00&quot; width=&quot;100%&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;&lt;img height=&quot;&quot; src=&quot;http://cfile26.uf.tistory.com/image/237B373D576EC3F118C6F5&quot; width=&quot;100%&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;&lt;img height=&quot;&quot; src=&quot;http://cfile7.uf.tistory.com/image/277B2C3D576EC3F118511C&quot; width=&quot;100%&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;&lt;img height=&quot;&quot; src=&quot;http://cfile9.uf.tistory.com/image/267BAA3D576EC3F118D789&quot; width=&quot;100%&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;&lt;img height=&quot;&quot; src=&quot;http://cfile23.uf.tistory.com/image/267BFD3D576EC3F117E3AF&quot; width=&quot;100%&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;&lt;img height=&quot;&quot; src=&quot;http://cfile23.uf.tistory.com/image/227C083D576EC3F2170CA6&quot; width=&quot;100%&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;&lt;img height=&quot;&quot; src=&quot;http://cfile24.uf.tistory.com/image/2679233D576EC3F21A4B75&quot; width=&quot;100%&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;&lt;img height=&quot;&quot; src=&quot;http://cfile24.uf.tistory.com/image/247BC73D576EC3F216CFE3&quot; width=&quot;100%&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;&lt;img height=&quot;&quot; src=&quot;http://cfile24.uf.tistory.com/image/2178D93D576EC3F21A1712&quot; width=&quot;100%&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;최대 조종 거리는 1km 정도에 최대 비행시간은 22분으로 7인치 크기의 터치 스크린을 적용한 컨트롤러와 촬영용 컨트롤러로 2인 1조로 함께 조작하면서 한 명은 비행에 집중하고 다른 한 명은 촬영에 집중하는 분업도 가능해 좀 더 완성도 높은 결과물을 기대할 수 있을 듯합니다. 가격이 1,900달러&lt;span&gt;(223만 원 정도)&lt;/span&gt;로 만만하지는 않지만, 애초에 촬영을 전문으로 하는 장비이니 자신에게 필요한 장비라면 체크해 두시는 게 좋을 것 같네요~^^ &lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;blockquote&gt;&lt;p&gt;[관련 링크 : &lt;a href=&quot;http://www.yuneec.com/droneproducts/Typhoon-H&quot; target=&quot;_blank&quot;&gt;Yuneec.com&lt;/a&gt;]&lt;br/&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;div&gt;
